export default containerElement => {

    console.log(containerElement.offsetWidth, containerElement.offsetHeight);

    (function(window){

        'use strict';

        function unityPlugin() {
            var _object = {};

            _object.init = function() {
                console.log("init foo")
            };

            Object.defineProperty(_object.init, "name", { value: "init" });

            return _object;

        }

        if(typeof(window.UnityPlugin) === 'undefined'){
            window.UnityPlugin = unityPlugin();
        }

        var gameInstance = UnityLoader.instantiate("unity-container", "/data/Build.json");


    })(window);

    function foo() {
        console.log("foo");
    }

    function plugin() {
        return window.UnityPlugin;
    }

    return {
        foo,
        plugin,
    }
}
